import React, { Component } from 'react';
import './style.scss';
import cardData from "../../cards.json";
import Card from '../Card';


class Game extends Component {
    render() {
        return (

            <div>
                {cardData.map((card) => (
                    <Card   
                        image={card.image} 
                        name={card.name} 
                        key={card.id}
                    />
                 ))}    
            </div>
        );
    }
}

export default Game;
